import React, { useState } from 'react';

function LikeDislike() {

    const [likecnt, setlikecnt] = useState(0);
    const [Dislikecnt, setDislikecnt] = useState(1);

    const likeadd = () => {
        setlikecnt(likecnt => likecnt + 1);
    }

    const Dislikeadd = () => {
        setDislikecnt(Dislikecnt => Dislikecnt + 1);
    }

    return (
        <div>
            <img src="./assets/icommonstr-thumb-14.svg"></img><button onClick={likeadd}>{likecnt}</button>
            <img src="./assets/icommonstr-thumb-20.svg"></img><button onClick={Dislikeadd}>{Dislikecnt}</button>
        </div>
    );
}

export default LikeDislike;
